Is there any way to use case-sensitive sorting in JavaScript?
I have tried this:
var a = ['a', 'A', 'b', 'B', 'c', 'C'];
a.sort();
// ["A", "B", "C", "a", "b", "c"]
But it gives me case-insensitive sorting.
