You can use the compareFunction parameter of the sort method to define your own sorting rules:
var a = ['a', 'A', 'b', 'B', 'c', 'C'];
a.sort(function(a, b) {
    if (a < b) return -1;
    if (a > b) return 1;
    return 0;
// ["A", "B", "C", "a", "b", "c"]
In this case, the compare function is simply comparing the two values directly, which for strings will use their character codes, resulting in a case-sensitive sort order.
The sort() method sorts the elements of an array in place and returns the array. The sort is not necessarily stable. The default sort order is according to string Unicode code points.
